import React, { useState } from "react";
import Banner from "../components/Banner";
import Heading from "../components/Heading";
import Slider from "react-slick";
import {
  acc1,
  arr1,
  fa1,
  fa2,
  fa3,
  fa4,
  fa5,
  fa6,
  featured1,
} from "../assets/images/products";
import FeaturedCard from "../components/FeaturedCard";
import AccessoryCard from "../components/AccessoryCard";
import FashionCard from "../components/FashionCard";
import { Link } from "react-router-dom";
import ServiceCard from "../components/ServiceCard";
import {
  ArrowBackRoundedIcon,
  ArrowForwardRoundedIcon,
  cc,
  fd,
  secure,
} from "../assets/icons";

import CategoryCard from "../components/CategoryCard";

// w-14 h-12 bg-[#0c1821] hover:bg-black duration-300 rounded-md text-2xl text-gray-400 flex justify-center items-center absolute top-0 right-20 shadow-shadowOne cursor-pointer z-10

function SampleNextArrow(props) {
  const { onClick } = props;
  return (
    <div
      className=""
      onClick={onClick}
    >
      <ArrowForwardRoundedIcon />
    </div>
  );
}

function SamplePrevArrow(props) {
  const { onClick } = props;
  return (
    <div
      className=""
      onClick={onClick}
    >
      <ArrowBackRoundedIcon />
    </div>
  );
}

const Homepage = () => {
  const [dotActive, setDocActive] = useState(0);
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    nextArrow: <SampleNextArrow />,
    prevArrow: <SamplePrevArrow />,
    beforeChange: (prev, next) => {
      setDocActive(next);
    },
    appendDots: (dots) => (
      <div
        style={{
          borderRadius: "10px",
          padding: "10px",
        }}
      >
        <ul
          style={{
            display: "flex",
            gap: "15px",
            justifyContent: "center",
            marginTop: "20px",
          }}
        >
          {" "}
          {dots}{" "}
        </ul>
      </div>
    ),
    customPaging: (i) => (
      <div
        style={
          i === dotActive
            ? {
                width: "12px",
                height: "12px",
                color: "blue",
                background: "#ff014f",
                borderRadius: "50%",
                cursor: "pointer",
              }
            : {
                width: "12px",
                height: "12px",
                color: "blue",
                background: "gray",
                borderRadius: "50%",
                cursor: "pointer",
              }
        }
      ></div>
    ),
  };


  const sliders = [
    {
        imgsrc : acc1,
        href: "/"
    },
    {
        imgsrc : acc1,
        href: "/"
    },
    {
        imgsrc : acc1,
        href: "/"
    },

]

  return (
    <section className="max-container px-5">
      <Banner />
      <div className="py-10 flex flex-col gap-10">
        {/* <div className="product-catalog">
          <Heading title={"Categories"} heading={"Browse By Category"} />

        </div> */}

        <Slider {...settings}>
    {sliders.map((e) => (
      <a href={e.href}>
      <div className="top-1/3  max-container flex flex-col xl:flex-row justify-between">
        <div className="rounded-lg shadow-shadowOne flex flex-col md:flex-row xl:flex-col gap-8 justify-center md:justify-start xl:justify-center ">
          <img className="object-cover " src={e.imgsrc} alt="sliderimage" />
        </div>
      </div>
      </a>
    ))}
  </Slider>

        <div className="product-catalog">
          <Heading
            title={"Featured Products"}
            heading={"Our Featured Products"}
          />
          <div className="grid grid-cols-5 gap-4">
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
            <FeaturedCard
              featured={featured1}
              title={"Slim Fit Dress Shirt"}
              start={"From 799"}
            />
